Here is the Solidity contract code that corresponds to the provided specifications:

```solidity
pragma solidity ^0.4.24;

contract Upgradable {
    address public upgradeabilityowner;
    string public version;
    address public implementation;

    modifier onlyUpgradeabilityOwner() {
        require(msg.sender == upgradeabilityowner);
        _;
    }

    function() payable public {
        if (implementation != address(0)) {
            assembly {
                let ptr := mload(0x40)
                calldatacopy(ptr, 0, calldatasize)
                let result := delegatecall(gas, implementation, ptr, calldatasize, 0, 0)
                let size := returndatasize
                returndatacopy(ptr, 0, size)
                switch result
                case 0 { revert(ptr, size) }
                default { return(ptr, size) }
            }
        }
    }

    function transferProxyOwnership(address newOwner) public onlyUpgradeabilityOwner {
        require(newOwner != address(0));
        upgradeabilityowner = newOwner;
    }

    function upgradeTo(string _version, address _implementation) public onlyUpgradeabilityOwner {
        require(_implementation != address(0));
        require(keccak256(abi.encodePacked(_version)) != keccak256(abi.encodePacked(version)));
        version = _version;
        implementation = _implementation;
    }

    function upgradeToAndCall(string _version, address _implementation, bytes data) payable public onlyUpgradeabilityOwner {
        upgradeTo(_version, _implementation);
        require(address(this).call.value(msg.value)(data));
    }
}
```

Note: This contract code is a basic implementation of an upgradable smart contract. The contract uses delegatecall in the fallback function to delegate all calls to an implementation contract. The implementation contract can be changed by the `upgradeabilityowner` through the `upgradeTo` and `upgradeToAndCall` functions. 

Please note that this contract doesn't have any logic for your complex conditions. It's hard to implement the contract based on the provided complex condition due to the lack of context and purpose of those conditions.
